    [],nt"revision_timestamp": "2016-05-31T01:08:47.280294",nt"name": "spotted-seal-distribution-map",nt"isopen":
    false,nt"url": null,nt"notes": "This dataset contains GIS layers that depict
    the known spatial distributions (i.e., ranges) and reported breeding areas of spotted
    seals (Phoca largha). It was produced as part of a U.S. Endangered Species Act status
    review, which included delineating the species in question and assessing its risk
    of extinction within the foreseeable future throughout all or a significant portion
    of its range. Its boundaries are based on previously published range maps and/or
    descriptions of the species' distribution in published or unpublished accounts.
    All boundaries should be considered approximate.",nt"license_title": null,nt"extras":
